trailingComments.value:
var names = domains.selectAll('text')
        .data(function(domain){
            console.log(domain)
            return [domain[0][0]]
        })
    .enter().append('text')
        .attr('x',0)
        .attr('y',10)
        .text(function(d){ 
            let ipr = getInterproId(d)
            if (ipr === 'Unintegrated'){
                return 'Unintegrated'
            } else {
                return ipr + ' ' + interproMetaData[ipr].description
            }
        })

